import React from "react";

import { logo, basket, account, search } from "../assets/index.js";
import "../Styles/styles.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <NavLink className="logo-nav" to="/">
        <img className="logo" src={logo} />
      </NavLink>
      <NavLink to="/sneakers/men" className="nav">
        <p>Men</p>
      </NavLink>
      <NavLink to="/sneakers/women" className="nav">
        <p>Women</p>
      </NavLink>
      <NavLink to="/sneakers/kids" className="nav">
        <p>Kids</p>
      </NavLink>
      <NavLink to="/sneakers/favorites" className="nav">
        <p>Favorites</p>
      </NavLink>
      <NavLink to="*" className="first-nav-icon">
        <img src={account} className="icon" />
      </NavLink>
      <NavLink to="/sneakers/favorites" className="nav-icon">
        <img src={basket} className="icon" />
      </NavLink>
    </nav>
  );
};

export default Navbar;
